@thefrugalexpat1 @chatwithkatblog But yes, @bookstothesky’s mentorship and encouragement was crucial. 

“Perfect is the enemy of done” is her motto, I think. 

Get it done, then improve it, in that order, otherwise you won’t ever get anything out there.

@thefrugalexpat1 @chatwithkatblog I don’t believe in perfection. There’s only better, and better, and better...

But @chatwithkatblog’s comments were so spot on. I know why I did the thing she picked up on - but could change the emphasis a little to make it clearer.

That’s some deep reading skills she’s got!

